import React from "react";
import "./Resume.css";
import Left from "./Left";
import Right from "./Right";

const Resume = () => {
  const [userData, setUserData]=React.useState({
    jobTitle: "",
    firstName: "",
    lastName: "",
    email: "",
    phone: "",
    country: "",
    city: "",
    github: "",
    linkedin: "",
    twitter: "",
    leetCode: "",
    language1: "",
    language2: "",
    collegeName: "",
    fieldOfStudy: "",
    passoutYear: "",
  })

  const handleUserDataChange=(newData)=>{
    setUserData(newData);
  }
  return (
    <>
      <div className="main-container">
        <Left onUserDataChane={handleUserDataChange} />
        <Right userData={userData} />
      </div>
    </>
  );
};
export default Resume;
